function toys(arr) {
    const sortedArr = arr.slice().sort((a, b) => a - b);
    console.log(sortedArr);
    const result = {};
    for (let i = 0; i < sortedArr.length; i++) {
        result[sortedArr[i]] = [sortedArr[i]];
        const temp = i;
        for (let j = temp + 1; j < sortedArr.length; j++) {
            console.log('item', sortedArr[j], sortedArr[temp] + 4 >= sortedArr[j]);
            if (1 * sortedArr[temp] + 4 >= sortedArr[j] * 1) {
                // result[sortedArr[temp]].push(sortedArr[j]); // no need, just to check
                ++i;
            } else {
                break;
            }
        }
        console.log(i);
    }
    console.log(result);
    return Object.keys(result).length;
}

